import DontShowAgain from '@components/ui/DontShowAgain';
import { usePortalRef } from '@hooks';
import { useCustomiserStore } from '@store/customiser';
import { Falsey } from 'lodash';
import { useState } from 'react';
import { createPortal } from 'react-dom';

interface NavHeaderScrollProps {
  styles?: {
    readonly [key: string]: string;
  };
}

const NavHeaderScroll = ({ styles }: NavHeaderScrollProps) => {
  const { navItems, selectedNav, setSelectedNav, deleteText } = useCustomiserStore();
  const popupPortalRef = usePortalRef('popupContainer');
  const [showPopup, setShowPopup] = useState<boolean>(false);

  const { texts, updateText } = useCustomiserStore((state) => state);
  const editText = texts?.find((g) => g.edit);

  const navIndex = navItems.findIndex((nav) => nav.name === selectedNav?.name);

  const finishedNavs = [
    {
      name: 'Fitting',
      type: 'fitting',
      required: true,
      hasActions: true,
      index: 0,
      finished: true,
    },
    {
      id: '16',
      name: 'Waist',
      type: 'part',
      required: true,
      hasActions: true,
      index: 1,
      finished: false,
    },
    {
      id: '17',
      name: 'T shaped panel',
      type: 'part',
      required: true,
      hasActions: true,
      index: 2,
      finished: false,
    },
    {
      id: '18',
      name: 'Second Area',
      type: 'part',
      required: true,
      hasActions: true,
      index: 3,
      finished: true,
    },
    {
      id: '19',
      name: 'Trim',
      type: 'part',
      required: true,
      hasActions: true,
      index: 4,
      finished: true,
    },
    {
      id: '20',
      name: 'Bottom Trim',
      type: 'part',
      required: true,
      hasActions: true,
      index: 5,
    },
    {
      id: '21',
      name: 'Crystals',
      type: 'part',
      required: false,
      hasActions: true,
      index: 6,
    },
    {
      id: '22',
      name: 'Tassels',
      type: 'part',
      required: false,
      hasActions: true,
      index: 7,
    },
    {
      name: 'Text',
      type: 'names',
      hasActions: true,
      index: 8,
    },
    {
      name: 'Flags',
      type: 'flags',
      hasActions: true,
      index: 9,
    },
    {
      name: 'Images',
      type: 'images',
      hasActions: true,
      index: 10,
    },
    {
      name: 'Size',
      type: 'size',
      required: true,
      hasActions: true,
      index: 11,
    },
  ];

  const isFinishedNav = (name?: string | Falsey) => {
    const finishedNav = finishedNavs.find((nav) => nav.name === name);
    return finishedNav?.finished;
  };

  const localStorageItem = localStorage.getItem('navConfirmText');
  const shouldShowConfirmCancelText = !localStorageItem;

  const cancelTextEdit = () => {
    if (editText?.key) {
      updateText(editText.key, {
        decalFreeze: false,
        edit: false,
        hasApplied: true,
      });

      if (!editText?.hasApplied) {
        deleteText(editText?.key);
      }
    }
    setSelectedNav(navIndex);
  };

  const navClickHandler = (index: number, name: string | Falsey) => {
    if (index === navIndex) return;
    if (editText?.text && name && name?.toLowerCase() !== 'text') {
      setShowPopup(true);
    } else {
      setSelectedNav(index);
    }
  };

  if (!popupPortalRef) {
    return null;
  }

  return (
    <>
      <div className={styles?.navHeaderScroll}>
        {navItems.map((item, index) => {
          const classes = `
            ${selectedNav?.name === item.name ? styles?.selected : ''}
            ${styles?.tab}
          `;
          return (
            <div className={classes} key={index} onClick={() => navClickHandler(index, item.name)}>
              <span className={`${styles?.dot} ${isFinishedNav(item.name) && styles?.finished}`} />
              <span className={styles?.navName}>{item.name}</span>
            </div>
          );
        })}
      </div>
      {showPopup &&
        shouldShowConfirmCancelText &&
        createPortal(
          <DontShowAgain
            cb={cancelTextEdit}
            setShowNotification={setShowPopup}
            notifName={'navConfirmText'}
          >
            <span>Cancel text customization?</span>
          </DontShowAgain>,
          popupPortalRef,
        )}
    </>
  );
};

export default NavHeaderScroll;
